R//edge/changelog/":{"tf":1.0}},"df":1}}}}}}}}},"d":{"docs":{},"df":0,"e":{"docs":{},"df":0,"v":{"docs":{},"df":0,"e":{"docs":{},"df":0,"l":{"docs":{},"df":0,"o":{"docs":{},"df":0,"p":{"docs":{"https://alu-schumacher.github.io/AUDITOR//edge/development/":{"tf":1.0}},"df":1}}}}}}},"m":{"docs":{},"df":0,"i":{"docs":{},"df":0,"g":{"docs":{},"df":0,"r":{"docs":{},"df":0,"a":{"docs":{},"df":0,"t":{"docs":{"https://alu-schumacher.github.io/AUDITOR//edge/migration/":{"tf":1.0}},"df":1}}}}}}}}},"documentStore":{"save":true,"docs":{"https://alu-schumacher.github.io/AUDITOR//edge/":{"body":"Auditor\nAuditor stands for Accounting Data Handling Toolbox For Opportunistic Resources.\nAuditor ingests accounting data provided by so-called collectors, stores it and provides it to the outside to so-called plugins.\nIt comes with a well-defined REST API which allows for the implementation of application-specific collectors and plugins. This makes it well suited for a wide range of use cases.\n\n  \n\nOverview of the AUDITOR ecosystem. AUDITOR accepts records from collectors, stores them in a PostgreSQL\ndatabase and offers these records to plugins which take an action based on the records.\nRunning Auditor\nAuditor can be run by compiling the source from the repository or by running a pre-built docker container.\nBoth methods require that the PostgreSQL database is installed and migrated beforehand.\nSetting up the PostgreSQL database\nUsing Docker\nYou can use Docker to start a PostgreSQL database:\n\nManual\nAlternatively, you can install PostgreSQL directly using your system's package manager and configure the database and user manually.\nFor the next steps you will need the database user and password, database name, host and port.\nMigrating the database\nUsing Docker\nYou can run the database migration using the Auditor Docker container.\nThe connection details for the database can be set using the AUDITOR_DATABASE__* environment variables, that are explained in the next section.\nIf you run the PostgreSQL database as a Docker container, execute the following command.\n\nIf the PostgreSQL database is not running in a Docker container, run\n\nReplace the DB_* variables with your corresponding values.\nManual\nMigrating the database manually requires cloning the Auditor repository and installing cargo and sqlx.\nA prerequisite is a working Rust setup, which can be installed either via your distributions package manager or via the following command:\n\nNow sqlx can be installed via cargo:\n\nClone the repository and cd into the directory.\n\nTo migrate the database, run the following from the root directory of the repo:\n\nUsing Docker\nThe easiest way to run Auditor is via a Docker container from Docker Hub or Github Container Registry.\nAuditor requires a properly configured PostgreSQL database.\nAfter installing PostgreSQL, the database needs to be migrated with sqlx.\nAUDITORs configuration can be adapted with environment variables.\nVariableDescription\nAUDITOR_APPLICATION__ADDRAddress to bind to (default 0.0.0.0)\nAUDITOR_APPLICATION__PORTPort to bind to (default 8000)\nAUDITOR_DATABASE__HOSTHost address of PostgreSQL database (default localhost)\nAUDITOR_DATABASE__PORTPort of PostgreSQL database (default 5432)\nAUDITOR_DATABASE__USERNAMEPostgreSQL database username (default postgres)\nAUDITOR_DATABASE__PASSWORDPostgreSQL database password (default password)\nAUDITOR_DATABASE__DATABASE_NAMEName of the PostgreSQL database (default auditor)\nAUDITOR_DATABASE__REQUIRE_SSLWhether or not to use SSL (default true)\nAUDITOR_LOG_LEVELSet the verbosity of logging. Possible values: trace, debug, info, warn, error (default info)\n\nUse docker run to execute Auditor:\n\nThe configuration parameters can be set by passing environment variables via -e:\n\nWe offer versioned tags (starting from 0.2.0) or the edge tag, which corresponds to the latest commit on the main branch.\nConfiguration files\nBesides environment variables, a YAML configuration file can be used:\n\nThis configuration file can be passed to Auditor and will overwrite the default configuration.\nIf you have compiled Auditor from source, pass the configuration file as first argument (i.e. cargo run &lt;path-to-config&gt; or ./auditor &lt;path-to-config&gt;)\nIf you run Auditor using Docker, then you first need to mount the configuration file inside the container, before you can use it.\nFurthermore, you need to call the Docker container with the auditor command as first argument and the path to the config file (location inside the container) as second argument.\n\nHowever, you should default to using environment variables for configuration when running Auditor using Docker.\nMetrics exporter for Prometheus\nMetrics for Prometheus are exposed via the /metrics endpoint.\nBy default HTTP metrics are exported.\nIn addition, database metrics are exported as well (optional).\nThese include the current number of records in the database, as a well as the number of records per site, group and user.\nDatabase metrics export can be configured in the configuration:\n\nHow often the database metrics are computed is defined by the frequency configuration variable.\nNote that computing the database metrics is a potentially expensive operation.\nTherefore it is advised to monitor the performance of Auditor when working with databases with a large number of records.\nThe frequency setting should be somewhat in accordance with the Prometheus scraping interval.\nCompiling from source\nAlternatively, Auditor can be compiled and run directly.\nInstructions for compiling Auditor from source can be found in the development documentation.\nPackages\nRPMs are provided for each release on the Github release page.\nCollectors\nCollectors are used to collect data from various sources.\nSee below for all currently available collectors.\nSLURM Collector\nThe Slurm collector collects information from slurm jobs based on the sacct command.\nIt can be installed from the provided RPM or can be built with this command:\n\nThe resulting binary can be found in target/x86_64-unknown-linux-musl/release/auditor-slurm-collector and should be placed on the Slurm head node.\nRun the Slurm collector with\n\nIdeally, you should run the Slurm collector as a service, e.g. by using a systemd unit file.\nExample:\n\nConfiguration\nThe Slurm collector is configured using a yaml-file. Configuration parameters are as follows:\nParameterDescription\naddrHost name or IP address of the Auditor instance.\nportPort of the Auditor instance.\nrecord_prefixPrefix for the record identifier. The full record identifier is then &lt;record_prefix&gt;-&lt;slurm-job-id&gt;.\njob_filterFilter jobs based on certain properties. See the Job filter section below.\nsacct_frequencyFrequency of executing the sacct command  (in seconds). Resulting records are first placed in a queue (based on a SQLite database) and later sent to the Auditor instance.\nsender_frequencyFrequency of sending new records from the sending queue to the Auditor instance.\nearliest_datetimeAfter starting the collector for the first time, only query jobs that started later than earliest_datetime. Has to follow the ISO 8601 standard\ndatabase_pathPath to the SQLite database that is used for the sending queue.\nsitesA list of potential sites that can be associated with a job. Each site has to have a name field. A site can be matched to a job based on the contents of a field in the job information using the only_if field. The only_if field needs to have a key, that corresponds to a field in the sacct output, and a matches field, used to match a certain value. Regular expressions are supported.\nmetaA list of meta objects that are added to the record. Each meta object needs to have a name that is used as the name of the meta object, and a key, that corresponds to a field in the job information. The type of the data can be specified with key_type. Possible values are Integer (default), IntegerMega (integer with a M behind the number), Time, String, DateTime, Id, Json. Per default, empty values are not allowed. This can be changed by setting key_allow_empty to true. Alternatively, a default value can be specified with default_value. Setting meta information can optionally be limited to a subset of records using the only_if syntax, as described above .\ncomponentsA list of components that is added to the record. A component needs to have a name, key, and key_type, similar to the meta configuration. One or multiple scores can be added to a component with the scores option. Each score config needs to have a name and a value. Setting scores can optionally be limited to a subset of records using the only_if syntax, as described above.\nlog_levelSet the verbosity of logging. Possible values: trace, debug, info, warn, error (default info).\n\nJob filter\nJob filters can be used to filter the slurm jobs when calling the sacct command.\nThe following filters are supported:\nParameterDescription\nstatusA list of acceptable job states. See SLURM JOB STATE CODES for a list of allowed values. Per default jobs with the completed state are queried.\npartitionA list of partition names. Per default no filter is applied.\nuserA list of users. Per default no filter is applied.\ngroupA list of groups. Per default no filter is applied.\naccountA list of accounts. Per default no filter is applied.\n\nExample configuration\n\nSLURM Epilog Collector\nThe Slurm epilog collector can installed from the provided RPM or can be built with this command:\n\nThe resulting binary can be found in target/x86_64-unknown-linux-musl/release/auditor-slurm-epilog-collector and is ideally placed on the Slurm head node.\nAdd this to your epilog shell script (on the slurm head node):\n\nThis will read the $SLURM_JOB_ID environment variable, which is only available in the context of a SLURM epilog script.\nInternally, scontrol is called to obtain the necessary information of the job.\nIf not all jobs are of relevance, filtering should be done in the epilog script such that the collector is only executed for relevant jobs.\nThis avoids unnecessary and potentially expensive calls to scontrol.\nSlurm provides a number of environment variables in the context of an epilog script which are listed in the Slurm documentation.\nExample:\n\nExample configurations\nThe following configuration shows how to set the Auditor host address and port.\nThe record_prefix will be used to prefix the Slurm job id in the record identifier (in this case it will be slurm-JOBID).\nThe site_name is the site_id which will be attached to the meta field of every record.\ncomponents defines how to extract accountable information from the call to scontrol and attaches scores to it.\nIn the context of components, name indicates how this component will be identified in the final record and key indicates the key which is to be extracted from the scontrol output.\nscores are optional.\nThe verbosity of logging can be set with the log_level option. Possible values are trace, debug, info (default), warn, and error.\n\nExtraction of components as well as adding of scores can be done conditionally, as shown in the following example configuration.\nThe matching is performed on values associated with certain keys in the scontrol output.\nRegex is accepted.\n\nHTCondor Collector\nThe collector relies on condor_history to retrieve the information about the jobs.\nThe collector runs periodically, creating records and committing them to the AUDITOR-instance using pyauditor.\nThe collector is run as follows:\n\n-c/--config CONFIG_FILE is required to be set and of the form as stated below.\nFurther, optional arguments are\n\nCommand line arguments override the values set in the config file.\nConfiguration\nThe collector is configured using a yaml-file. Configuration parameters are as follows:\nParameterDescription\nstate_dbPath to the sqlite-database used for persistent storage of the job ids last processed by the collector.\nrecord_prefixPrefix used for all records put into the AUDITOR-database.\nintervalInterval in seconds between runs of the collector.\npoolThe -pool argument used for the invocation of condor_history.\nschedd_namesList of the schedulers used for the -name argument of the invocation of condor_history.\njob_statusList of job statuses considered. See HTCondor magic numbers.\nmetaMap key/value pairs put in the records meta field. The key is used as the key in the records meta-variables, the values are entrys.If multiple entrys are given for specified name, the values are appended to a list. A special case is site, which is a list of entrys, but only the first match is used.\ncomponentsList of components (entrys) put in the records components. Each component can contain a list of scores (entrys).\n\nThe following parameters are optional:\nParameterDefaultDescription\naddrhttp://127.0.0.1Address of the AUDITOR-instance. If this is set, port must also be specified.\nport8080Port of the AUDITOR-instance. If this is set, addr must also be specified.\ntimeout30Timeout in seconds for the connection to the AUDITOR-instance.\n\nentry\nAn entry describes how to get the value for a meta-var or component from the job.\nUnlike meta-variables, components contain a name-field, which is used as the name of the component.\nIf the entry has a key-field, the value is taken from the corresponding ClassAd.\nElse, if the entry has a factor-field, this factor is used as the value.\nElse, if the entry has a name-field, this name is used as the value (this is used for the site-meta-var).\nElse, the value is not set.\nIf the entry has a matches-field, the value is matched against the regex given in matches.\nIn case the regex contains a group, the value is set to the (first) matching group, else the name-field is used.\nIf the entry contains an only_if-field, the value is only returned if the value of the ClassAd in only_if.key  matches the regex given in only_if.matches.\nSee below for an example config and the use of such entrys.\nExample config\n\nKubernetes Collector\nThis collector retrieves information from two sources: the Kubernetes API and a Prometheus instance. This is necessary because Kubernetes does not expose resource metrics like CPU time via it's API. This means that the collector needs to be able to access the API as well as Prometheus.\nThe easiest way to ensure access to the API is by running the collector directly on Kubernetes via the provided Helm Chart. Prometheus needs to be able to access the Kubelets of your cluster. If it is installed on Kubernetes, make sure it has some persistent storage. A small tutorial for an example setup can be found here.\nThe following section explains the configuration of the collector.\nThe collector can be started manually\n\nOr it can be installed on Kubernetes via the single Helm Chart\n\nor through the parent Chart\n\nConfiguration\nConfiguration settings can be provided via a yaml file when run manually or through the Helm Chart. The parameters are as follows:\nParameterDefaultDescription\nauditor_addrAddress of AUDITOR instance\nauditor_port8000Port of AUDITOR\nprometheus_addrAddress of Prometheus\nprometheus_portPort of Prometheus\nrecord_prefix\"\"Is prepended to all record IDs\nearliest_datetimeNowCollector will ignore all pods finished before this time. Should be ISO 8601. Note that the collector will save the timestamp of the last successful request to Kubernetes and will always choose the later time between this timestamp and earliest_datetime.\nauditor_timeout10sTimeout for connecting to AUDITOR\nprometheus_timeout60sTimeout for a single Prometheus query\ncollect_interval60sInterval for collecting pod info from Kubernetes\nmerge_interval60sInterval for collecting info from Prometheus. This also sets how often records will be sent to AUDITOR.\ndatabase_path\".\"Directory to house the persistent sender queue\njob_filterSets which pods to account. See below\nbacklog_interval300sHow long to wait before retrying to fetch metrics from Prometheus\nbacklog_maxretries2How often we will retry to fetch metrics from Prometheus for each pod. Will send an incomplete record after this\nlog_levelINFOLogging level\n\nJob filter settings:\nParameterDefaultDescription\nnamespace[\"default\"]A whitelist of namespaces to consider\nlabels[]A list of labels. A pod will be accounted if all conditions are true\n\nExample Config\n\nPlugins\nPlugins are used to retrieve data from Auditor for further processing.\nSee below for all currently available collectors.\nAPEL Plugin\nThe APEL plugin creates messages and sends them to the APEL server. The plugin can either create summary messages for the current month, or individual job messages. Sync messages for the current month are created in both cases.\nThe plugin is provided as a pip package and as a Docker container from Docker Hub or from the GitHub Container Registry.\nTwo CLI commands are available after the installation via pip: auditor-apel-publish and auditor-apel-republish.\nauditor-apel-publish runs periodically at a given report interval.\n\nauditor-apel-republish runs once and submits a report of jobs between two dates for a given site.\n\nThe config file is written in YAML format and has the main sections plugin, site, authentication, auditor, and at least one of summary_fields or individual_job_fields.\nExample config:\n\nThe individual parameters in the config file are:\nSectionParameterDescription\npluginlog_levelCan be set to TRACE, DEBUG, INFO, WARNING, ERROR, or CRITICAL (with decreasing verbosity). TRACE might produce a lot of output if message_type is set to individual_jobs, since the message that will be sent to APEL is printed.\nplugintime_json_pathPath of the time.json file. The JSON file should be located at a persistent path and stores the stop times of the latest reported job per site, and the time of the latest report to APEL.\npluginreport_intervalTime in seconds between reports to APEL.\npluginmessage_typeType of message to create. Can be set to summaries or individual_jobs.\nsitepublish_sinceDate and time in ISO 8601 format (in UTC, hence add +00:00) after which jobs will be published. Only relevant for first run when no time.json is present yet.\nsitesites_to_reportDictionary of the sites that will be reported. The keys are the names of the sites in the GOCDB, the values are lists of the corresponding site names in the AUDITOR records.\nauthenticationauth_urlURL from which the APEL authentication token is received.\nauthenticationams_urlURL to which the reports are sent.\nauthenticationclient_certPath of the host certificate.\nauthenticationclient_keyPath of the host key.\nauthenticationca_pathPath of the local certificate folder.\nauthenticationverify_caControls the verification of the certificate of the APEL server. Can be set to True or False (the latter might be necessary for local test setups).\nauditoripIP of the AUDITOR instance.\nauditorportPort of the AUDITOR instance.\nauditortimeoutTime in seconds after which the connection to the AUDITOR instance times out.\nauditorsite_meta_fieldName of the field that stores the name of the site in the AUDITOR records.\n\nThe main sections summary_fields and individual_job_fields have the subsections mandatory and optional. mandatory contains the fields that have to be present in the APEL message, therefore the plugin needs to know how to get the information from the AUDITOR records. The mandatory fields are:\nNameData type\nCpuDurationint\nNormalisedCpuDuration (only for summary_fields)int\nNormalisedWallDuration (only for summary_fields)int\n\nThere are actually more mandatory fields, but they are handled internally and don't need any input from the user.\noptional fields can be used to provide additional information to APEL:\nNameData type\nGlobalUserNamestr\nVOstr\nVOGroupstr\nVORolestr\nSubmitHoststr\nInfrastructure (only for summary_fields)str\nInfrastructureType (only for individual_job_fields)str\nInfrastructureDescription (only for individual_job_fields)str\nNodeCountint\nProcessorsint\nLocalUserId (only for individual_job_fields)str\nFQAN (only for individual_job_fields)str\nServiceLevel (only for individual_job_fields)float\nServiceLevelType (only for individual_job_fields)str\n\nThe information about the possible fields, their required data types, and what is mandatory or optional, is taken from https://github.com/apel/apel/tree/master/apel/db/records.\nPlease make sure that the information you extract from the AUDITOR records has the correct data type as expected by APEL!\nDifferent field types are available, depending on the source of the value that is needed: ComponentField, MetaField, ConstantField, ScoreField, NormalisedField, and NormalisedWallDurationField. The type to be used is indicated after the name of the field with a leading exclamation mark, e.g. Processors: !ComponentField.\nComponentField extracts the value from a component in the AUDITOR record. The mandatory parameter of this field is name, which gives the name of the component in the AUDITOR record. If the value needs to be modified, e.g. if it has another unit than the one expected by APEL, the optional parameter divide_by has to be used.\nMetaField extracts the value from the meta information in the AUDITOR record. The mandatory parameter of this field is name, which gives the name of the component in the AUDITOR record. If the value needs to be modified, one of the optional parameters regex or function can be used. regex takes a regular expression, searches the value for this expression, and returns the complete match, function has the parameters name and parameters, where the latter is optional and can be used to provide additional parameters to the function. If you want to manipulate the value of the Metafield with a custom function, it has to be present in utility.py and can be added via a pull request.\nConstantField has the mandatory parameter value, which is exactly what will be written in the message field.\nScoreField extracts the score value from a given component from the AUDITOR record. The mandatory parameters are name, the name of the score, and component_name, the name of the component.\nNormalisedField has the parameters base_value and score, where score is a ScoreField and base_value a ComponentField. The resulting value is the product of the score and the base value.\nNormalisedWallDurationField has the parameter score, which is a ScoreField. The value of the score is multiplied with the runtime of the AUDITOR record.\nWhen using the Docker container, auditor-apel-publish for example can be started with\n\nIn this example, the local directory config_folder contains the config file auditor_apel_plugin.yml, the client certificate hostcert.pem, and the client key hostkey.pem. The JSON file time.json will also be written in config_folder. The corresponding entries in the config file would be:\n\nPriority Plugin\nThe priority plugin takes the resources provided by multiple groups and computes a priority for each of these groups based on how many resources were provided.\nThis allows one to transfer provided resources on one system to priorities in another system.\nThe computed priorities are set via shelling out, and the executed commands can be defined as needed.\nThe priority plugin is available as RPM or can be built with the command:\n\nThe resulting binary can be found in target/x86_64-unknown-linux-musl/release/auditor-priority-plugin and is ideally placed on a node where the priorities should be set.\nThe priority plugin runs continuously. Ideally, it is installed as a systemd service.\nPriorities are updated at a frequency that can be set via the configuration.\nA typical configuration for the SLURM batch system may look like this:\n\nThe Auditor instance that is providing the records can be configured with the auditor block.\nHere, addr refers to the address of the machine that hosts the Auditor instance. The port can be specified with port.\nThe resources used for calculating the priorities can be configured via the components field.\nIt defines which components to extract from the components field of the record (NumCPUs in this example), as well as the corresponding score (HEPSPEC in this example).\nMultiple components can be extracted.\nThe configured components and scores must be part of the records.\nThe resources of each component will be multiplied by the corresponding score and the resulting provided resource per group is the sum of all these.\nThe records considered in the computation can be limited to all records which finished in the past X seconds via the duration field (in seconds).\nOmitting this field takes all records in the database into account.\nThe frequency of recalculating the priorities can be set via the frequency field.\nVia the group_mapping field, it is possible to attach certain additional information to the individual groups which are to be considered in the calculation.\nIn the example configuration above are three groups group{1,2,3}, where each has a corresponding partition part{1,2.3}.\nThese mappings can be accessed when constructing the commands which will be executed after computing the priorities by using {N} where N corresponds to the number of the element in the list of the group_mapping.\nFor instance, for group1, the string {1} indicates part1 while for group2 the same string {1} indicates part2.\nThe group name can be accessed via the {group} string.\nThe commands field in the configuration illustrates the usage of these mappings.\nThis allows one to adapt the commands for the various groups involved.\nIn the commands field one can also see a string {priority}, which will be replaced by the computed priority for the group.\nAnother special string, {resources} is available, which is replaced by the computed provided resource per group.\nThe command is executed for each group separately and multiple commands can be provided with a list.\nThe verbosity of logging can be set with the log_level option. Possible values are trace, debug, info (default), warn, and error.\nThe priority plugin allows for real-time monitoring of the computed resources and priorities via a prometheus endpoint.\nPer default, the prometheus endpoint is disabled.\nIt can be enabled by adding the prometheus block to the configuration or by setting the enable field of this block to true.\nInside the prometheus block, the address and port of the HTTP server that provides the prometheus metrics can be specified via the addr and port fields.\nThe metrics will then be available at &lt;addr&gt;:&lt;port&gt;/metrics\nThe metrics list specifies the metrics that are exported.\nRight now the values ResourceUsage (for the amount of provided resources in the given duration)\nand Priority (for the calculated priority value) are supported.\nPriority computation modes\nAs stated above, the priorities are computed from the provided resources of each group.\nHowever, the computed resources and the priorities are in different units and span different ranges.\nTherefore a mapping between resources and priorities needs to be in place.\nThis plugin offers two computation_modes: FullSpread and ScaledBySum.\nVia min_priority and max_priority, lower and upper limits on the computed priority are set.\n\nFullSpread:  This mode will spread the resources on the full range given by min_priority and max_priority, such that the group with the least provided resources will be assigned a priority equal to min_priority and the group with the most provided resources will be assigned a priority equal to max_priority. All other groups are distributed inside that range according to their provided resources. This creates maximum spread of the priorities. A disadvantage of this approach is that the computed priorities of two consecutive runs can be substantially different, leading to large jumps in priorities.\nScaledBySum: Computes the priorities such that max_priority is equal to the sum of all provide resources plus min_priority. This leads to a smoother change of priorities over multiple runs of the plugin. The maximum priority can only be reached by a group if all other groups provide no resources.\n\nAuditor Clients\nTo facilitate the development of collectors and plugins, client libraries for Rust and Python are offered which handle the interaction with the Auditor server.\nFor details please consult the respective documentation pages for the Rust client and the Python client.\nAPI\nWhile the client libraries provide an interface to communicate with the Auditor server, it is also possible to directly use the REST API provided by the Auditor server.\nThe following table provides an overview of the different API endpoints that are provided.\nThe individual endpoints are further detailed down below.\nActionEndpoint\nHealth checkGET /health_check\nGet Prometheus metricsGET /metrics\nAdd single recordPOST /record\nAdd multiple recordsPOST /records\nUpdate recordPUT /record\nGet single record by record_idGET /record/&lt;record_id&gt;\nGet all recordsGET /records\nGet subset of recordsGET /records?&lt;query_string&gt;\n\n\nHealth check: This endpoint is used to check the health status of the Auditor server.\nA successful response (200 OK) indicates that the server is running and reachable.\nAdd single record: This endpoint is used to add a single record to the database.\nThe record data should be included in the request body in JSON format and needs to be serializable into the RecordAdd struct.\nAdd multiple records: Similar to the previous endpoint, but it's used to add multiple records at once.\nThe request body should contain an array of records in JSON format.\nUpdate record: This endpoint is used to update an existing record.\nThe record data should be included in the request body in JSON format and needs to be serializable into the RecordUpdate struct.\nCurrently, only the stop_time of a record is updateable.\nGet single record by record_id: This endpoint is used to retrieve a single record by its record_id.\nGet all records: This endpoint is used to retrieve all records from the database.\nConsider using the filter options (see the next item below) instead of querying the complete set of records, as this method can take a long time if there are large amounts of records stored in the database.\nGet subset of records: This endpoint is used to retrieve a subset of records with filters applied on the server side.\nThe filter options need to be provided as query string and are detailed in the client tutorial.\nIn the event of an invalid query string, such as the inclusion of an unsupported variable, the server responds with an error (400 BAD REQUEST).\n\nIn the event of unforeseen errors, the server will respond with a 500 INTERNAL SERVER ERROR.\nExamples\nKubernetes\nTo install an AUDITOR stack on a Kubernetes cluster we provide a Helm Chart in ./helmcharts/ that includes the subcharts\n\nauditor for the AUDITOR server\nauditor-collector for the Kubernetes collector\nauditor-prometheus for a Prometheus to scrape the kubelets\nauditor-apel for the APEL plugin\n\nAll charts can be (de-)activated in the partent charts values.yaml individually, so everything can be run on Kubernetes or separately.\nWith the exception of the server chart, all deployments should be provided with persistent storage, while the auditor chart requires a Postgres.\nFor the sake of this example we will provide a small Docker compose setup to run a Postgres instance and install all other components on Kubernetes.\nTo set up Postgres we use the following files:\n\n\n\nThe first start of Postgres is done with\n\nto run the migration.\nThe configuration of the AUDITOR stack is done through the values.yaml files of the charts.\nIn particular, we need to provide the Postgres address in the parent chart or the auditor chart.\nWe then install everything via the Helm Charts:\n\nNote that, per default, none of the pods will have a persistent storage. It is however advised to provide the collector, the APEL plugin and especially the Prometheus instance with persistent storage.\nThe value.yaml files contain a section with a simple example for this, using local paths.\nIf you want to use it, set persistentVolume.use to true in the appropriate values.yaml and add the node to use in persistentVolume.nodeAffinity.\nThen, on the nodes in question the directory /srv/auditor/{apel,collector,prometheus} should exists.\nIf you want to run the APEL plugin on Kubernetes you need to provide it with certificate files ca.pem, client.pem and client.key in the files directory of its chart.\nLicense\nLicensed under either of\n\nApache License, Version 2.0, (LICENSE-APACHE or http://www.apache.org/licenses/LICENSE-2.0)\nMIT License (LICENSE-MIT or http://opensource.org/licenses/MIT)\n\nat your option.\nContribution\nUnless you explicitly state otherwise, any contribution intentionally submitted for inclusion in the work by you, as defined in the Apache-2.0 license, shall be dual licensed as above, without any additional terms or conditions.\n","id":"https://alu-schumacher.github.io/AUDITOR//edge/","title":"Auditor"},"https://alu-schumacher.github.io/AUDITOR//edge/about/":{"body":"AUDITOR\nAUDITOR is a modular accounting ecosystem that is able to cover\na wide range of use cases and infrastructures. Accounting data is gathered via so-called col-\nlectors which are designed to monitor batch systems, COBalD/TARDIS, cloud schedulers or\nother sources of information. The data is stored in a database and the access to the data\nis handled by the core component of AUDITOR which provides a REST API, and both\na Rust and a Python client. So-called plugins can take action based on accounting records.\nFunding\nThis work was supported by the Federal Ministry of Education and Research (BMBF) within the project\n05H18VFRC1 - \"Entwicklung und Optimierung der Nutzung heterogener Rechenressourcen (Pilotmanahme ErUM-Data)\"\nand 05H21VFRC2: \"Weiterentwicklung, Integration und Optimierung\nvon föderierten digitalen Infrastrukturen für ErUM (Verbundprojekt FIDIUM)\".\n","id":"https://alu-schumacher.github.io/AUDITOR//edge/about/","title":"About"},"https://alu-schumacher.github.io/AUDITOR//edge/changelog/":{"body":"Changelog\nAll notable changes to the AUDITOR project will be documented in this file.\nChangelog.\n","id":"https://alu-schumacher.github.io/AUDITOR//edge/changelog/","title":"ChangeLog"},"https://alu-schumacher.github.io/AUDITOR//edge/development/":{"body":"This document covers instructions for developers of Auditor and its plugins/collectors.\nContributing to Auditor\nGetting started\nFirst, fork the AUDITOR repo to your account. Then clone the forked repo to your machine. Also add the original repository as upstream remote.\n\nWorking on a new features\nCreate a new branch in your fork\n\nYou can now create and push new commits as usual.\n\nCreating a pull request\nWe follow a rebased-based workflow. Therefore, you need to rebase your branch to the latest main branch of the upstream repo.\n\nYou then can create a pull request through GitHub's UI.\nCompiling Auditor from source\nThis section describes how to set up the required development environment in order to compile Auditor from source.\nIt also covers cross compiling and static linking against musl instead of glibc in order to obtain a maximally portable binary.\nPrerequisites\nCompiling Auditor requires\n\nRust (see below)\nDocker\nsqlx-cli (see below)\nPostgreSQL client (psql)\nbunyan (optional, see below)\n\nRust\nRequires a recent Rust version (MSRV 1.56.1) and cargo.\nIdeally installed via rustup:\n\nsqlx\n\nbunyan\nFor nicer logs install bunyan:\n\nRunning Auditor via cargo\n\nCalling ./scripts/db_init.sh will start a temporary PostgreSQL database in a Docker container and will automatically migrate the database.\nIf you plan to run Auditor like this in production, make sure to properly set up a database and instead of calling db_init.sh pass the correct settings to auditor via the configuration environment variables mentioned above.\nBuilding requires a running database, because database queries are checked against the database during runtime! This can be disabled with:\n\nFor nicer logs pipe the output through bunyan:\n\nNote that this will be a debug build which will not pass all optimizations during compilation.\nFor maximum performance a release build is necessary:\n\nRunning the tests\n\nOutput logs while running the tests:\n\nBuilding binaries\nBinaries used in production should be built in release mode:\n\nThe binary can then be found in target/release/auditor.\nMake sure a database is up and running when starting Auditor.\nStatic linking and cross compiling\nThe binary will only link to the system glibc.\nFully statically linked binaries can be obtained by statically linking against musl instead auf glibc.\nThis can be beneficial when cross compiling, in particular for older targets (e.g. CentOS7).\nThis requires the musl dev tools to be installed on the system where Auditor is compiled.\nThe exact packages needed depends on your Linux distribution.\nFurthermore, the x86_64-unknown-linux-musl target for Rust must be installed (once):\n\nThen cross-compilation with static linking can be done via\n\nThe resulting binaries will be placed in target/x86_64-unknown-linux-musl/release.\nAdding new plugins and collectors\nTODO: Instructions for adding new plugins/collectors (especially directory structure, CI config, etc)\nDocumentation\nGithub pages\nThis webpage is based on the Zola framework.\nFor local development, install the zola CLI program and run\n\nin the root directory of the Auditor repo.\nThe local version of the webpage is now available at http://127.0.0.1:1111/.\nRust documentation\nA local version of the Rust documentation can be built with\n\nUse the--open flag to directly open the documentation in your browser.\nPython client\nThe documentation of the python client is based on the Sphinx framework.\nA local version of the documentation can be built with\n\nThe documentation can then be found in pyauditor/docs/_build/html/.\nCreating a new release\nFollow the steps below in order to create a new release.\nExample PR: https://github.com/ALU-Schumacher/AUDITOR/pull/547\n\nUpdate the version number in all Cargo.toml files\nRun cargo update to update dependencies in Cargo.lock\nIf sqlx is updated, don't forget to also change the version in all workflows, containers, documentation, etc.\nUpdate the version number in all pyproject.toml files\nFinalize the changelog\n\nRename Unreleased to version number, add date\nAdd new Unreleased section with all subsections (Breaking changes, Security, Added, Changed, Removed)\nAt the bottom: Add link target for new version\nAt the bottom: Update link target for unreleased version\n\n\nFinalize the migration guide\n\nRename Unreleased to version number\n\n\nUpdate changelog in RPM .spec files\nCreate PR and wait for approval from other team member\nPublish auditor crate first (you will need a crates.io API token)\n\nThen run the publish workflow for the auditor-client crate and all rust-based collectors/plugins (cd into corresponding dirs)\n\nauditor-client (prepend cargo commands with SQLX_OFFLINE=true)\nplugins/priority\ncollectors/slurm (prepend cargo commands with SQLX_OFFLINE=true)\ncollectors/slurm_epilog\n\n\nMerge PR\nCreate tag for version\n\nThis triggers the build of the pyauditor package and the python-based collectors/plugins\nThis triggers the build of the docker containers and pushes them to DockerHub and GHCR\nThis triggers a GitHub release\n\nUpdate the release notes by copying the corresponding section from the changelog\n\n\n\n\nAnnounce in Mattermost AUDITOR channel\nUpdate the pyauditor version number in tardis (and update the code of the AUDITOR plugin if the release introduced breaking changes)\n\n","id":"https://alu-schumacher.github.io/AUDITOR//edge/development/","title":"Development"},"https://alu-schumacher.github.io/AUDITOR//edge/migration/":{"body":"From 0.6.3 to unreleased/0.7.0\nFrom 0.6.2 to 0.6.3\nUpdate to sqlx 0.8.2\nUse this command to update the sqlx-cli to 0.8.2\n\ncargo install --version=0.8.2 sqlx-cli --no-default-features --features postgres,rustls,sqlite\n\nFrom 0.5.0 to 0.6.2\nAuditor DB:\n\nWARNING: Please create a backup of the database before running the migration script.\nAUDITOR db should be migrated to use the new schema. Run sqlx migrate run --source migration from the AUDITOR home directory. It is also possible using the container which can be found here Documentation\n\nApel plugin\n\nThe APEL message can now be configured via the config. An updated example config file can be found in the Documentation.\nauditor-apel-republish now needs the arguments --begin-date and --end-date instead of --month and --year. The format is yyyy-mm-dd hh:mm:ss+00:00, e.g. 2023-11-29 21:10:54+00:00.\n\nFrom 0.4.0 to 0.5.0\nApel plugin\n\nThe format of the config file was changed from INI to YAML. An updated example config file can be found in the Documentation.\nThe stop times of the latest reported job per site and the time of the latest report to APEL are now stored in a JSON file instead of a SQLite database. Therefore, the config parameter time_db_path has to be changed to time_json_path.\nTo migrate an existing database to a JSON file, run migration-0_4_0-to-0_5_0.py located in the scripts folder:\n\n\nThis already requires a config file with YAML format.\nDocker container\nThe Auditor Docker container can now be used to run database migrations. For details, see the documentation.\nIf you run Auditor using the Docker container and provide an external config file, you need to change the way how you run the Docker container:\n\nOld\n\nNew\n\n\nI.e., you need to add auditor as the first argument before pointing to the configuration file.\nDevelopment\nUpdate to sqlx 0.7.4\nUse this command to update the sqlx-cli to 0.7.4\n\ncargo install --version=0.7.4 sqlx-cli --no-default-features --features postgres,rustls,sqlite\n\nFrom 0.3.0/0.3.1 to 0.4.0\nAUDITOR\nREST APIs\nAuditor REST APIs are changed as shown in the table below.\nActionBeforeAfter\nHealth check/health_check (GET)/health_check (GET)\nAdd record/add (POST)/record (POST)\nUpdate record/update (POST)/record (PUT)\nInsert Bulk recordsDid not exist/records (PUT)\nGet all records/get (GET)/records (GET)\nGet records since/get/[started/stopped]/since/{date} (GET)/records?state=[started/stopped]&amp;since={date} (GET)\n\n/record endpoint handles single record operations such as adding one record, updating one record and querying one record.\n/records endpoint handles multiple and bulk record operations such as inserting bulk records and querying multiple records.\nApel plugin\nThe config parameter site_name_mapping is removed and the structure of the config parameter sites_to_report is changed. sites_to_report is now a dictionary, where the keys are the site names as configured in the GOCDB, and the values are lists of the corresponding site names in the AUDITOR records.\nBefore:\n\nAfter:\n\nRemoved\n/get_[started/stopped]_since endpoint is removed due to the introduction of advanced query. The auditor client and pyauditor client still contains the get_started_since and get_stopped_since\nfunctions but throws a deprecated warning if used.\nDevelopment\nUpdate to sqlx 0.7.3\nUse this command to update the sqlx-cli to 0.7.3\n\ncargo install --version=0.7.3 sqlx-cli --no-default-features --features postgres,rustls,sqlite\n\nFrom 0.2.0 to 0.3.0\nSlurm collector\nNew filter options for querying slurm jobs are available.\nDue to this, a new section job_filter has been introduced for the config file.\nThe job_status field has been renamed to status and is now part of the job_filter section.\nBefore:\n\nAfter:\n\nThe new filter options are partition, user, group, and account and work similar to the status filter.\nPriority plugin\nThe priority plugin now supports exporting metrics for the amount of provided resources and the updated priority to Prometheus.\nThe metrics can be accessed via a GET request to the /metrics endpoint.\nBecause the metrics endpoint provided by the Prometheus exporter needs to be available all the time, the architecture of the\npriority plugin has been changed. It now will run continuously. In most cases, it should be started as a systemd service.\nThe structure of the config file has changed. The addr and port options are now put under a common auditor section.\nThe frequency of recalculation for the provided resources and priorities can now be controlled with the frequency field, which assumes that the number given is in seconds.\nIt defaults to 1 hour (i.e. 3600s).\nThe Prometheus exporter can be configured in the prometheus section.\nIt can be enabled and disabled with the enable field.\nThe address and port of the HTTP server that serves the metrics can be set with the addr and port fields.\nThe metrics list specifies the metrics that are exported. Right now the values ResourceUsage (for the amount of provided resources in the given duration)\nand Priority (for the calculated priority value) are supported.\nThe prometheus section is optional. If it is not present, it has the same effect as setting enable to false.\nBelow, you find an example of the priority plugin configuration before and after the change.\n\n\nBefore\n\n\n\nAfter\n\n\n\nAUDITOR\nStandardized REST APIs\nAuditor REST APIs are changed as shown in the table below.\nActionBeforeAfter\nHealth check/health_check (GET)/health_check (GET)\nAdd record/add (POST)/record (POST)\nUpdate record/update (POST)/record (PUT)\nGet all records/get (GET)/record (GET)\nGet records since/get/[started/stopped]/since/{date} (GET)/record?state=[started/stopped]&amp;since={date} (GET)\n\nDevelopment\nUpdate to sqlx 0.7.2\nUse this command to update the sqlx-cli to 0.7.2\n\ncargo install --version=0.7.2 sqlx-cli --no-default-features --features postgres,rustls,sqlite\n\nFrom 0.1.0 to 0.2.0\nApel plugin\n\nThe config file now needs to have a field cpu_time_unit present, which describes the unit of total CPU time in the AUDITOR records.\nPossible values are seconds or milliseconds.\nSupport for Python 3.6 and Python 3.7 has been dropped. Please move to a newer version of python.\n\nAuditor client\n\nSupport for Python 3.6 and Python 3.7 has been dropped. Please move to a newer version of python.\nDue to the update of the pyo3 library, the timezone of datetime objects now needs to be datetime.timezone.utc instead of pytz.utc\nwhen creating a new record:\n\nWhen the datetime object is already in UTC\n\nBefore\n\nAfter\n\n\n\nIf it is in local time\n\nBefore\n\nAfter\n\n\n\n\n\n\nAuditor server\n\nUpdating a non-existent record now returns an HTTP 404 error instead of HTTP 400 error\n\nDocker containers\n\nThe main tag was replaced with the edge tag. In addition, we also now offer docker tags corresponding to releases, i.e., use the tag 0.2.0 for this release.\n\nHTCondor plugin\n\nSupport for Python 3.6 and Python 3.7 has been dropped. Please move to a newer version of python.\n\nDevelopment\nUpdate to sqlx 0.7.1\nUse this command to update the sqlx-cli to 0.7.1\n\ncargo install --version=0.7.1 sqlx-cli --no-default-features --features postgres,rustls,sqlite\n\n","id":"https://alu-schumacher.github.io/AUDITOR//edge/migration/","title":"Migration"}},"docInfo":{"https://alu-schumacher.github.io/AUDITOR//edge/":{"body":2818,"title":1},"https://alu-schumacher.github.io/AUDITOR//edge/about/":{"body":84,"title":0},"https://alu-schumacher.github.io/AUDITOR//edge/changelog/":{"body":8,"title":1},"https://alu-schumacher.github.io/AUDITOR//edge/development/":{"body":516,"title":1},"https://alu-schumacher.github.io/AUDITOR//edge/migration/":{"body":687,"title":1}},"length":5},"lang":"English"}